import { useState, useEffect } from 'react'

const Diet = () => {

    const [plan, setplan] = useState({})

    useEffect(() => {

        const getplan = async () => {
            const Uplan = await getUserplan()

            setplan(Uplan)
        }

        getplan()

    }, [])

    const [diet, setDiet] = useState({})

    useEffect(() => {

        const getdite = async () => {
            const diet = await getDite()

            setDiet(diet)
        }

        getdite()

    }, [])


    const getUserplan = async () => {
        const response = await fetch(`http://localhost:5000/api/userinfo/${sessionStorage.getItem("tokenId")}`);
        const plan = await response.json()
        return plan

    }

    const getDite = async () => {
        const response = await fetch('http://127.0.0.1:5000/api/diet/');
        const dite = await response.json()
        return dite
    }


    let DITE = {
        "plan": "Weigth",
        "date": {
            "Monday": {
                "Breakfast": "",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            },
            "Tuesday": {
                "Breakfast": "shiro ",
                "Lunch": " shiro",
                "Supper": " shiro",
                "Dinner": " shiro,shiro"
            },
            "Wednesday": {
                "Breakfast": " ",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            },
            "Thursday": {
                "Breakfast": " ",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            },
            "Friday": {
                "Breakfast": " ",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            },
            "Saturday": {
                "Breakfast": " ",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            },
            "Sunday": {
                "Breakfast": " ",
                "Lunch": " ",
                "Supper": " ",
                "Dinner": " "
            }
        }
    }
